import Badge1IMG from "./circle check.svg";
import Badge2IMG from "./intel.svg";
import Badge3IMG from "./plusnotenote+.svg";
import Badge4IMG from "./house.svg";


export const Badges = () => {
  return (


<div className="mx-9">
  <div className="flex items-center">
    {/* Badge 1 */}
    <div className="w-1/8 bg-white rounded-lg shadow-md text-center p-5">
      <img src={Badge1IMG} alt="Icon 1" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Guaranteed</p>
    </div>

    {/* Badge 2 */}
    <div className="w-1/8 bg-white rounded-lg shadow-md text-center p-5">
      <img src={Badge2IMG} alt="Icon 2" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Services</p>
    </div>

    {/* Badge 3 */}
    <div className="w-1/8 bg-white rounded-lg shadow-md text-center p-5">
      <img src={Badge3IMG} alt="Icon 3" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Avaibility</p>
    </div>

    {/* Badge 4 */}
    <div className="w-1/8 bg-white rounded-lg shadow-md text-center p-5">
      <img src={Badge4IMG} alt="Icon 4" className="w-12 mx-auto" />
      <p className="text-sm mt-2">Based Here</p>
    </div>
  </div>
</div>



  );
};
export default Badges;
